hr][bt_icons el_class=\"\" el_style=\"\" position=\"btIconsNormalPosition\"][bt_icon icon=\"fa_f003\" icon_title=\"jenna.wilson@dentalcare.com\" icon_type=\"btIcoDefaultType\" icon_color=\"btIcoDefaultColor\" icon_size=\"btIcoSmallSize\" url=\"mailto:jenna.wilson@dentalcare.com\" target=\"no_target\"][/bt_icon][/bt_icons][bt_hr top_spaced=\"topExtraSmallSpaced\" bottom_spaced=\"not-spaced\" transparent_border=\"noBorder\" el_class=\"\" el_style=\"\"][/bt_hr][bt_icons el_class=\"\" el_style=\"\" position=\"btIconsNormalPosition\"][bt_icon icon=\"fa_f073\" icon_title=\"Book appointment\" icon_type=\"btIcoDefaultType\" icon_color=\"btIcoDefaultColor\" icon_size=\"btIcoSmallSize\" url=\"appointments\" target=\"no_target\"][/bt_icon][/bt_icons][bt_hr top_spaced=\"topSemiSpaced\" bottom_spaced=\"not-spaced\" transparent_border=\"noBorder\" el_class=\"\" el_style=\"\"][/bt_hr][/bt_column][bt_column width=\"2/3\" align=\"left\" vertical_align=\"inherit\" border=\"no_border\" cell_padding=\"btDoublePadding\" animation=\"animate animate-fadein\" text_indent=\"no_text_indent\" highlight=\"no_highlight\" background_color=\"\" transparent=\"\" inner_background_color=\"\" background_image=\"\" el_class=\"\" el_style=\"\"][bt_row_inner][bt_column_inner width=\"1/2\"][bt_text]\n\n<section class=\"page-section pad-top-2\">A dentist is a physician whose practice is in the field of dentistry. This involves the mouth, teeth, gums and related areas. Some studies have shown that diseases relating to the teeth and gums can be indicative or indicators of some health issues. The health of the mouth is essential to the general overall health of the body and a dentist will encourage and assist their patients in maintaining a healthy mouth by regular cleaning and check-ups.A dentist performs many important duties in the maintenance of oral health. Check-ups are a major part of the job and are important for patients keeping on top of their oral care. In addition to general check-ups, general dentistry involves basic treatments that can be done at a regular dental office. Such procedures might include filling a tooth, performing a minor surgical procedure such as a tooth extraction, and cleaning and polishing teeth. A dentist will encourage patients to practice good dental care by brushing and flossing and getting regular cleanings as these good habits can help prevent cavities and other tooth and gum diseases.Within dentistry, there are specific specialties which require further training, creating expertise in a particular area. Examples of specialties include:</section><section class=\"page-section\"></section>[/bt_text][/bt_column_inner][bt_column_inner width=\"1/2\"][bt_text]\n\n<section class=\"page-section\">The workplace tends to be a dental office or dental hospital and the environments tend to be typical clinical environments - clean and sterile and working with the same professionals every day. The variation will be in the patients and interaction with different people every day. As all towns and cities require dental offices, it should be possible for a dentist to find a workplace within easy commuting distance.Like most careers in the health industry, a dentist is required to be caring and compassionate as well as clever and competent. Since many people are afraid of visiting a dental office for treatment, it is beneficial for a dentist to be good with people and to be able to reassure them and explain procedures to them in a simple way.Academic qualifications vary around the world but generally require a bachelor of science degree and then further postgraduate studies. Most countries performing western medicine require a dentist to have completed four years of postgraduate study to qualify as either a DDS (Doctor of Dental Surgery) or DMD (Doctor of Dental Medicine). Other dental degrees valid in various countries include: BDent (Bachelor of Dentistry); BDSc (Bachelor of Dental Science); MDent (Master of Dentistry); and DD (Doctor of Dentistry).</section><section class=\"page-section\"></section>[/bt_text][/bt_column_inner][/bt_row_inner][bt_hr top_spaced=\"topSmallSpaced\" bottom_spaced=\"bottomSmallSpaced\" transparent_border=\"border\" el_class=\"\" el_style=\"\"][/bt_hr][bt_icons el_class=\"btTextRight\" el_style=\"\" position=\"btIconsNormalPosition\"][bt_icon icon=\"fa_f09a\" icon_title=\"\" icon_type=\"btIcoOutlineType\" icon_color=\"btIcoDefaultColor\" icon_size=\"btIcoSmallSize\" url=\"#\" target=\"no_target\"][/bt_icon][bt_icon icon=\"fa_f099\" icon_title=\"\" icon_type=\"btIcoOutlineType\" icon_color=\"btIcoDefaultColor\" icon_size=\"btIcoSmallSize\" url=\"#\" target=\"no_target\"][/bt_icon][bt_icon icon=\"fa_f0d5\" icon_title=\"\" icon_type=\"btIcoOutlineType\" icon_color=\"btIcoDefaultColor\" icon_size=\"btIcoSmallSize\" url=\"#\" target=\"no_target\"][/bt_icon][bt_icon icon=\"fa_f0e1\" icon_title=\"\" icon_type=\"btIcoOutlineType\" icon_color=\"btIcoDefaultColor\" icon_size=\"btIcoSmallSize\" url=\"#\" target=\"no_target\"][/bt_icon][bt_icon icon=\"fa_f1ca\" icon_title=\"\" icon_type=\"btIcoOutlineType\" icon_color=\"btIcoDefaultColor\" icon_size=\"btIcoSmallSize\" url=\"#\" target=\"no_target\"][/bt_icon][/bt_icons][/bt_column][/bt_row][/bt_section][bt_section layout=\"boxed\" top_spaced=\"topSemiSpaced\" bottom_spaced=\"bottomSmallSpaced\" skin=\"dark\" full_screen=\"no\" vertical_align=\"inherit\" divider=\"yes\" back_image=\"531\" back_color=\"\" back_video=\"\" video_settings=\"\" parallax=\"\" parallax_offset=\"\" animation=\"\" animation_back=\"\" animation_impress=\"\" el_id=\"\" el_class=\"btAccentColorBackground\" el_style=\"\"][bt_row][bt_column width=\"1/1\" align=\"left\" vertical_align=\"inherit\" border=\"no_border\" cell_padding=\"default\" animation=\"animate animate-fadein animate-moveup\" text_indent=\"no_text_indent\" highlight=\"no_highlight\" background_color=\"\" transparent=\"\" inner_background_color=\"\" background_image=\"\" el_class=\"\" el_style=\"\"][bt_header 