are consequat varius.\n\n[/bt_tabs_items][bt_tabs_items headline=\"Awards &amp; Honours\"]\n<ul>\n	<li>Praesent blandit volutpat eros vel egestas.</li>\n	<li>Mauris ac sem a turpis dictum tristique. Donec et suscipit eros.</li>\n	<li>Cras porttitor eros dui, et condimentum sapien auctor ac.</li>\n	<li>Nam maximus tellus odio, in placerat lorem varius a.</li>\n	<li>Phasellus sit amet nulla diam.</li>\n	<li>Aliquam imperdiet, urna at lobortis blandit, metus justo vestibulum eros, a vulputate augue odio condimentum tortor.</li>\n	<li>Vivamus nec ullamcorper nisl, ut molestie elit.</li>\n</ul>\n[/bt_tabs_items][/bt_tabs][/bt_column][/bt_row][/bt_section]','Doctors profile','','publish','closed','closed','','doctors-profile','','','2023-10-20 01:22:38','2023-10-20 01:22:38','',25,'http://medical.bold-themes.com/dentist/?page_id=323',0,'page','',0),(328,1,'2015-12-29 09:33:58','2015-12-29 09:33:58','','bllurred-background','','inherit','open','closed','','bllurred-background','','','2015-12-29 09:33:58','2015-12-29 09:33:58','',0,'http://centromedicoemanuel.com/wp-content/uploads/2015/12/bllurred-background.jpg',0,'attachment','image/jpeg',0),(334,1,'2015-12-29 10:13:13','2015-12-29 10:13:13','','shutterstock_272306351-dark','','inherit','open','closed','','shutterstock_272306351-dark','','','2015-12-29 10:13:13','2015-12-29 10:13:13','',0,'http://centromedicoemanuel.com/wp-content/uploads/2015/12/shutterstock_272306351-dark.jpg',0,'attachment','image/jpeg',0),(338,2,'2015-12-29 10:28:50','2015-12-29 10:28:50','<p>Your Name (required)<br />\r\n    [text* your-name] </p>\r\n\r\n<p>Your Email (required)<br />\r\n    [email* your-email] </p>\r\n\r\n<p>Select your doctor<br/>\r\n[select Doctor \"Jenna Wilson\" \"Audrey Button\" \"Emma Beckett\" \"Hellen Hill\" \"Arianna McDonald\"]</p>\r\n\r\n<p>Select appointment date<br/>\r\n[date* date-638]</p>\r\n\r\n<p>Additional Message<br />\r\n   [textarea AdditionalMessage x10] </p>\r\n\r\n\r\n<p>[submit \"BOOK APPOINTMENT\"]</p>\n1\